import axios from "axios";
import { useState } from "react";


function Createanime() {
    const [animeurl, setAnimeurl] = useState()
    const [studiourl, setStudiourl] = useState()
    const [name, setName] = useState()
    const [altername, setAltername] = useState()
    const [desc, setDesc] = useState()
    const [rating, setRating] = useState()
    const [numep, setNumep] = useState()
    const [dates, setDates] = useState()
 
    const submit = () => {
        axios
            .post("http://localhost:8080/api/auth/reg", {
                animeurl: animeurl,
                studiourl: studiourl,
                name: name,
                altername: altername,
                description: desc,
                rating: rating,
                numep: numep,
                dates: dates
            }, 
            {withCredentials: true})
            
            .then((response) => {
                console.log(response)

            })
            
            .catch((err) => {
                console.log('Ошибка : ',err)
            })
    }; 


    return (  
        <>
            <input type="url" placeholder="anime url"/> <br />
            <input type="url" placeholder="studio url"/><br />
            <input type="text" placeholder="name"/><br />
            <input type="text" placeholder="alter name"/><br />
            <input type="text" placeholder="desc"/><br />
            <input type="number" placeholder="reting"/><br />
            <input type="number" placeholder="num ep"/><br />
            <input type="date" placeholder="dates"/><br />

            <input type="button" value={'Создать аниме'} onClick={submit}/>
        </>
    );
}

export default Createanime;
